<html>   <head>   <title>Lab 8</title>   <link rel="stylesheet" href="styles.css"> <meta charset="UTF-8">       <script src="https://ajax.googleapis.com/ajax/libs/jquery/2.1.1/jquery.min.js"></script>       <title>title</title>   </head>   <body onLoad="buildHtmlTable('#excelDataTable')">   <table id="excelDataTable" border="1">  <caption>Racers</caption> </table>  <script> var myList = [{"Place":1,"bibNumber":1,"Name":"Smith S","Time":1006}];  function buildHtmlTable(selector) {   var columns = addAllColumnHeaders(myList, selector);    for (var i = 0; i < myList.length; i++) {     var row$ = $('<tr/>');     for (var colIndex = 0; colIndex < columns.length; colIndex++) {       var cellValue = myList[i][columns[colIndex]];       if (cellValue == null) cellValue = "";       row$.append($('<td/>').html(cellValue));     }     $(selector).append(row$);   } }  function addAllColumnHeaders(myList, selector) {   var columnSet = [];   var headerTr$ = $('<tr/>');    for (var i = 0; i < myList.length; i++) {     var rowHash = myList[i];     for (var key in rowHash) {       if ($.inArray(key, columnSet) == -1) {         columnSet.push(key);         headerTr$.append($('<th/>').html(key));       }     }   }   $(selector).append(headerTr$);    return columnSet; }       </script> </body>  </html>
